import React from 'react';
import ListaImagenes from './ListaImagenes';
const Favoritos = ({imagenes}) => {
    return ( 
        <>
            <h1>Imagenes que te han gustado</h1>
            <ListaImagenes
            imagenes={imagenes}/>
        </>
     );
}
 
export default Favoritos;
